import React from 'react';
import {Line} from 'react-chartjs-2';

const data = {
  labels: ['January', 'February', 'March', 'April', 'May', 'June', 'July'],
  datasets: [
    {
      label: 'Mon',
      fill: false,
      lineTension: 0.2,
      backgroundColor: 'rgba(75,192,192,0.4)',
      backgroundColor: '#ffffff',
      borderColor: 'rgba(75,192,192,1)',
      borderCapStyle: 'butt',
      borderDash: [],
      borderDashOffset: 0.0,
      borderJoinStyle: 'miter',
      pointBorderColor: 'rgba(75,192,192,1)',
    //   pointBackgroundColor: '#fff',
      pointBackgroundColor: '#000000',
      pointBorderWidth: 5,
      pointHoverRadius: 5,
      pointHoverBackgroundColor: 'rgba(75,192,192,1)',
      pointHoverBorderColor: 'rgba(220,220,220,1)',
      pointHoverBorderWidth: 2,
      pointRadius: 1,
      pointHitRadius: 10,
      data: [65, 59, 80, 81, 56, 55, 40]
    }
  ],
  gridLines: [{
      display: false
  }]
};

export default (props) => {
    data.labels = props.labels ? props.labels : [...Array(props.data.stints.length).keys()]
    data.data = props.data.stints
    console.log(data.data)
    console.log(data.labels)
    return (
      <div style={{width: '3500px', margin:'20px', borderRadius: '20px', padding: '20px', backgroundColor: 'whitesmoke'}} >
        <div>{props.title}</div>
        {/* <div style={{backgroundColor: 'white'}}> */}

        <Line data={
            // labels: 'yooo',
            data
        } 
            // options={{backgroundColor: 'rgba(0, 0, 0, 0.5)'}}
        />
        {/* // height={40} width={2} options={{ maintainAspectRatio: false }} */}
        {/* </div> */}
      </div>
    );
};
